export default function handler(request, response) {
    const type = request.query.type

    switch (type) {
        case 'titles':
            response.status(200).json({
                body: titles
            });
            break;
        case 'artists':
            response.status(200).json({
                body: artists
            });
            break;
        case 'uniqueArtists':
            response.status(200).json({
                body: uniqueArtists
            });
            break;
        default:
            response.status(400).json({
                body: `Error: Invalid Type\nExpected either "title" or "artist" got "${type}"`
            });
            break;
    }
}